About: What would you give for that big break? Would you have the courage to risk it all? Well, Shayla doesn't feel there's that much at risk. Boring husband, hum-drum homelife, empty luxuries. So, when the chance comes to show what she's got, she goes for it. And what she's got! Not just the perfect face... that body! That ass! (She uses it to the fullest in one of her very rare and incredible anal scenes!) But above all, she's got what lures us most. She's got... The Look!
